import React from 'react';


function Overview() {
    return (
        <div>
            <hr size="2" id="overview" />
            <div className="presentation" id="general">
                <h1 className="blockTitle">
                    Pesquisa de Opinião da Comunidade Acadêmica de Graduação
                </h1>

            </div>
        </div>
    );
};

export default Overview;
